/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number}
 */
var minSizeSubarray = function(nums, target) {
    let sum = 0;
    for (let num of nums) {
        sum += num;
    }
    if (sum === target) return nums.length;
    if (sum < target) return -1;

    let prefixSum = new Map([[0, -1]]);
    let currentSum = 0, minLength = Infinity;
    for (let i = 0; i < nums.length * 2; i++) {
        currentSum += nums[i % nums.length];
        if (prefixSum.has(currentSum - target)) {
            minLength = Math.min(minLength, i - prefixSum.get(currentSum - target));
        }
        // To handle cases where the subarray starts after the first iteration over nums
        if (i < nums.length) {
            prefixSum.set(currentSum, i);
        }
    }
    return minLength === Infinity ? -1 : minLength + 1;
};
